#include "ShmBuffer.hpp"

#define windowSize 700
#define computePartners 2
#define imageSize windowSize*windowSize*7

int visRank = -1;
int commSize = -1;

JavaVM *jvm;                      // Pointer to the JVM (Java Virtual Machine)

void doRender(JNIEnv *env, jclass inVisClass, jobject inVisObject) {
    jmethodID mainMethod = env->GetMethodID(inVisClass, "main", "()V");
    if(mainMethod == nullptr) {
        if (env->ExceptionOccurred()) {
            env->ExceptionDescribe();
        } else {
            std::cout << "ERROR: function main not found!";
//            std::exit(EXIT_FAILURE);
        }
    }
    env->CallVoidMethod(inVisObject, mainMethod);
}

void updateMemory(JNIEnv *env, jobject renderObject, jmethodID methodID, int memKey, bool pos) {
    jvm->AttachCurrentThread(reinterpret_cast<void **>(&env), NULL);
    std::string pName;
    if(pos) pName = "/";
    else pName = "/home";

    ShmBuffer *buf;
    buf = new ShmBuffer(pName, memKey, true);
    double *str = NULL;
    ptr_with_size pws{};
    jobject byteBuffer;

    while(true) {
        buf->update_key(true);
        pws = buf->attach();
        str = (double *)pws.ptr;
        byteBuffer = (env)->NewDirectByteBuffer((void*) str, pws.size);
        std::cout<<"Java method updatepos/updateprops has been called!"<<std::endl;
        env->CallVoidMethod(renderObject, methodID, byteBuffer, memKey);
        std::cout<<"Back after updating pos/props"<<std::endl;
        buf->detach(false); //detach from the previous key
    }
}

void getMemoryPos(JNIEnv *env, jclass renderClass, jobject renderObject) {
    jvm->AttachCurrentThread(reinterpret_cast<void **>(&env), NULL);

    jmethodID updatePosMethod = env->GetMethodID(renderClass, "updatePos", "(Ljava/nio/ByteBuffer;I)V");
    if(updatePosMethod == nullptr) {
        if (env->ExceptionOccurred()) {
            env->ExceptionDescribe();
        } else {
            std::cout << "ERROR: function updatePos not found!";
//            std::exit(EXIT_FAILURE);
        }
    }

    std::vector<std::thread> threads;

    for(int i = 0; i <computePartners; i++){
        threads.emplace_back(&updateMemory, env, renderObject, updatePosMethod, i, true);
    }

    for(int i = 0; i < computePartners; i++) {
        threads[i].join();
    }
}

void getMemoryProps(JNIEnv *env, jclass renderClass, jobject renderObject) {
    jvm->AttachCurrentThread(reinterpret_cast<void **>(&env), NULL);

    jmethodID updatePropsMethod = env->GetMethodID(renderClass, "updateProps", "(Ljava/nio/ByteBuffer;I)V");
    if(updatePropsMethod == nullptr) {
        if (env->ExceptionOccurred()) {
            env->ExceptionDescribe();
        } else {
            std::cout << "ERROR: function updateProps not found!";
//            std::exit(EXIT_FAILURE);
        }
    }

    std::vector<std::thread> threads;

    for(int i = 0; i < computePartners; i++){
        threads.emplace_back(&updateMemory, env, renderObject, updatePropsMethod, i, false);
    }

    for(int i = 0; i < computePartners; i++) {
        threads[i].join();
    }
}

void sendImage(JNIEnv *e, jobject clazz, jobject image) {
    jbyte *buf;
    MPI_Request req;
    MPI_Status stat;
    buf = (jbyte *) e->GetDirectBufferAddress(image);
    MPI_Isend((void *)buf, imageSize, MPI_BYTE, 0, 0, MPI_COMM_WORLD, &req);
    MPI_Wait(&req, &stat);
}

