    //    options[1].optionString = (char *)"-Djava.library.path=/Users/argupta/Documents/scenery-insitu/src/test/kotlin/graphics/scenery/insitu/";fscenery
    options[1].optionString = (char *)
            "-Dscenery.Renderer=OpenGLRenderer";
    vm_args.version = JNI_VERSION_1_6;             // minimum Java version
    vm_args.nOptions = 2;                          // number of options
    vm_args.options = options;
    vm_args.ignoreUnrecognized = false;     // invalid options make the JVM init fail
    //=============== load and initialize Java VM and JNI interface =============
    jint rc = JNI_CreateJavaVM(&jvm, (void **) &env, &vm_args);  // YES !!
    std::cout<<"Hello world"<<std::endl;
    delete options;    // we then no longer need the initialisation options.
    if (rc != JNI_OK) {
        // TO DO: error processing...
        std::cin.get();
        std::exit(EXIT_FAILURE);
    }

    //=============== Display JVM version =======================================
    std::cout << "JVM load succeeded: Version " << std::endl;
    jint ver = env->GetVersion();
    std::cout << ((ver >> 16) & 0x0f) << "." << (ver & 0x0f) << std::endl;

    int threadLevel;
    MPI_Init_thread(NULL, NULL, MPI_THREAD_MULTIPLE, &threadLevel);
    std::cout << "MPI initialized with thread level " << threadLevel << ". The desired level was " << MPI_THREAD_MULTIPLE << std::endl;
    MPI_Comm_rank(MPI_COMM_WORLD, &visRank);
    std::cout << "My rank is " << visRank << std::endl;
    MPI_Comm_size(MPI_COMM_WORLD, &commSize);
    std::cout<<"Communicator size is "<<commSize<< std::endl;

    // Rendering Processes
    jclass rendererClass = env->FindClass("graphics/scenery/insitu/InVisRenderer");  // try to find the class
    if(rendererClass == nullptr) {
        if( env->ExceptionOccurred() ) {
            env->ExceptionDescribe();
        } else {
            std::cerr << "ERROR: class not found !" <<std::endl;
            std::exit(EXIT_FAILURE);
        }
    }
    // if class found, continue
    std::cout << "Class found" << std::endl;
    jmethodID ctor = env->GetMethodID(rendererClass, "<init>", "()V");  // FIND AN OBJECT CONSTRUCTOR
    if (ctor == nullptr) {
        if( env->ExceptionOccurred() ) {
            env->ExceptionDescribe();
        } else {
            std::cerr << "ERROR: constructor not found !" <<std::endl;
            std::exit(EXIT_FAILURE);
        }
    }

    //if constructor found, continue
    jobject rendererObject = env->NewObject(rendererClass, ctor);
    if (!rendererObject) {
        if (env->ExceptionOccurred()) {
            env->ExceptionDescribe();
        } else {
            std::cout << "ERROR: class object is null !";
            std::exit(EXIT_FAILURE);
        }
    }

    jfieldID winSizeField = env->GetFieldID(rendererClass, "windowSize", "I");
    env->SetIntField(rendererObject, winSizeField, windowSize);

    jfieldID compPartnersField = env->GetFieldID(rendererClass, "computePartners", "I");
    env->SetIntField(rendererObject, compPartnersField, computePartners);

    jmethodID initArraysMethod = env->GetMethodID(rendererClass, "initializeArrays", "()V");
    if(initArraysMethod == nullptr) {
        if (env->ExceptionOccurred()) {
            env->ExceptionDescribe();
        } else {
            std::cout << "ERROR: function initializeArrays not found!";
//            std::exit(EXIT_FAILURE);
        }
    }
    env->CallVoidMethod(rendererObject, initArraysMethod);

    jclass openGLRendererClass = env->FindClass("graphics/scenery/backends/opengl/OpenGLRenderer");  // try to find the class
    if(openGLRendererClass == nullptr) {
        if( env->ExceptionOccurred() ) {
            env->ExceptionDescribe();
        } else {
            std::cerr << "ERROR: OpenGLRenderer class not found !" <<std::endl;
            //std::exit(EXIT_FAILURE);
        }
    }

    JNINativeMethod methods[] { { (char *)"sendImage", (char *)"(Ljava/nio/ByteBuffer;)V", (void *)&sendImage } };  // mapping table

    if(env->RegisterNatives(openGLRendererClass, methods, 1) < 0) {                        // register it
        if( env->ExceptionOccurred() ) {
            env->ExceptionDescribe();
        } else {
            std::cerr << "ERROR: Could not register natives for OpenGLRenderer !" <<std::endl;
            //std::exit(EXIT_FAILURE);
        }
    }

    std::cout<<"starting thread: updatePosData"<<std::endl;

    std::thread updatePosData(getMemoryPos, env, rendererClass, rendererObject);

    std::cout<<"starting thread: updatePropsData"<<std::endl;

    std::thread updatePropsData(getMemoryProps, env, rendererClass, rendererObject);

    std::cout<<"calling function: doRender"<<std::endl;

    doRender(env, rendererClass, rendererObject);

    updatePosData.join();
    updatePropsData.join();

    jvm->DestroyJavaVM();
